import React, { useEffect, useState } from "react";
import Header from "../../components/Headers/Header";
import { Card, CardBody, CardTitle, Container, Row, Col } from "reactstrap";
import jwtDecode from "jwt-decode";

const Home = () => {
  const [stats, setStats] = useState({
    medicalRecords: 0,
    prescriptions: 0,
    patients: 0,
  });

  const [userInfo, setUserInfo] = useState({
    name: "",
    email: "",
    role: "",
    avatar: "",
    age: 0,
    location: "",
    job: "",
    university: "",
    awards: 0,
    prescriptions: 0,
    comments: 0,
  });

  const getInitials = (name) => {
    if (!name) return "";
    return name
      .split(" ")
      .map((word) => word[0])
      .join("")
      .toUpperCase();
  };

  useEffect(() => {
    // Gọi API thống kê
    fetch("https://api.example.com/clinic-stats")
      .then((response) => response.json())
      .then((data) => {
        setStats({
          medicalRecords: data.medicalRecords || 0,
          prescriptions: data.prescriptions || 0,
          patients: data.patients || 0,
        });
      })
      .catch((error) => console.error("Error fetching stats:", error));

    const token = localStorage.getItem("token");
    if (!token) return;

    let decoded;
    try {
      decoded = jwtDecode(token);
    } catch (error) {
      console.error("Invalid token");
      return;
    }

    fetch("http://localhost:5001/api/users/users", {
      headers: {
        Authorization: `Bearer ${token}`
      }
    })
      .then(res => res.json())
      .then(users => {
        const currentUser = users.find(u => u._id === decoded.id);
        if (!currentUser) return;

        setUserInfo({
          name: currentUser.name || "Không rõ",
          email: currentUser.email || "",
          role: currentUser.role || "staff",
          avatar: currentUser.avatar || "",
          age: currentUser.age || 27,
          location: currentUser.location || "Chưa rõ",
          job: currentUser.job || "Chưa rõ",
          university: currentUser.university || "FPT University",
          awards: 22,
          prescriptions: 10,
          comments: 89
        });
      })
      .catch((error) => console.error("Error fetching user info:", error));
  }, []);

  return (
    <>
      <Header />
      <Container className="mt-4">
        <Row>
          <Col lg="4">
            <Card className="text-center shadow">
              <CardBody style={{ paddingTop: "4rem" }}>
                <div className="card-profile-image" style={{ marginTop: "-60px", display: "flex", justifyContent: "center" }}>
                  {userInfo.avatar ? (
                    <img
                      src={userInfo.avatar}
                      alt="avatar"
                      className="rounded-circle shadow"
                      style={{
                        width: "120px",
                        height: "120px",
                        objectFit: "cover",
                        border: "4px solid white"
                      }}
                    />
                  ) : (
                    <div
                      className="rounded-circle bg-primary text-white d-flex align-items-center justify-content-center shadow"
                      style={{
                        width: "120px",
                        height: "120px",
                        fontSize: "32px",
                        fontWeight: "bold",
                        border: "4px solid white"
                      }}
                    >
                      {getInitials(userInfo.name)}
                    </div>
                  )}
                </div>

                <div className="d-flex justify-content-around mb-3 mt-3">
                  <div>
                    <h5>{userInfo.awards}</h5>
                    <small>Bằng khen</small>
                  </div>
                  <div>
                    <h5>{userInfo.prescriptions}</h5>
                    <small>Đơn khám</small>
                  </div>
                  <div>
                    <h5>{userInfo.comments}</h5>
                    <small>Comments</small>
                  </div>
                </div>

                <h4>{userInfo.name}, {userInfo.age}</h4>
                <p className="text-muted mb-1">{userInfo.location}</p>
                <p className="font-weight-bold mb-1">{userInfo.job}</p>
                <p>{userInfo.university}</p>
                <hr />
                <p className="text-muted">{userInfo.email}</p>
                <a href="#" className="text-primary">Show more</a>
              </CardBody>
            </Card>
          </Col>

          <Col lg="8">
            <Row>
              <Col md="6" xl="4">
                <Card className="card-stats mb-4">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle tag="h5" className="text-uppercase text-muted mb-0">
                          Giấy khám bệnh
                        </CardTitle>
                        <span className="h2 font-weight-bold mb-0">{stats.medicalRecords}</span>
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-danger text-white rounded-circle shadow">
                          <i className="fas fa-chart-bar" />
                        </div>
                      </Col>
                    </Row>
                  </CardBody>
                </Card>
              </Col>

              <Col md="6" xl="4">
                <Card className="card-stats mb-4">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle tag="h5" className="text-uppercase text-muted mb-0">
                          Đơn Thuốc
                        </CardTitle>
                        <span className="h2 font-weight-bold mb-0">{stats.prescriptions}</span>
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-warning text-white rounded-circle shadow">
                          <i className="fas fa-chart-pie" />
                        </div>
                      </Col>
                    </Row>
                  </CardBody>
                </Card>
              </Col>

              <Col md="6" xl="4">
                <Card className="card-stats mb-4">
                  <CardBody>
                    <Row>
                      <div className="col">
                        <CardTitle tag="h5" className="text-uppercase text-muted mb-0">
                          Bệnh nhân
                        </CardTitle>
                        <span className="h2 font-weight-bold mb-0">{stats.patients}</span>
                      </div>
                      <Col className="col-auto">
                        <div className="icon icon-shape bg-yellow text-white rounded-circle shadow">
                          <i className="fas fa-users" />
                        </div>
                      </Col>
                    </Row>
                  </CardBody>
                </Card>
              </Col>
            </Row>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default Home;
